import React from 'react';
import './App.css';



const App = () => {
	return (
		<div className ='app-wrapper'>
			<header className ='header'>
				<img src='https://upload.wikimedia.org/wikipedia/commons/d/db/Zeronet_logo.png' />
			</header>
			<nav className ='menu'>
				<div>Profile</div>
				<div>Messages</div>
			</nav>

		 <div className ='content'>
			Mine content
		 </div>
		</div>
	);
}








export default App;
